de:
Am Sonntag, dem 25. Juni, öffnet das Château de Pierry erneut die Tore seines privaten Gartens, um Sie zu seinem zweiten musikalischen Picknick zu empfangen.

Zu diesem Anlass wird Ihnen ein sommerliches Menü serviert, zu dem Sie bei Ihrer Ankunft ein Glas Champagner von Paul Gobillard erhalten.
- Die kleine Salatschüssel mit Linsen aus der Champagne, begleitet von Kirschtomaten, marinierten Artischockenherzen, Zucchini, roten Zwiebeln, Rucola, Pestosauce und Mozzarella di Bufala;
- Sein Metzgerstück vom Grill oder seine Geflügelsuppe oder sein Wolfsbarschfilet, begleitet von Röstkartoffeln oder/und kleinem Gemüse ;
- Sein gereifter Brie de Meaux ;
- Seine Delikatesse Magnum** by B vom Haus Baillet in Ay- Champagne, ein Signaturdessert, das von der Jury der Besten Bäckerei Frankreichs genehmigt und verkostet wurde

* *Magnum - Mousse tentation Yuzu, leichte Himbeercreme, Himbeeren, Biskuit rosa champenois punché au Yuzu, Schokolade

Seine 1/2 Flasche Wasser ;
Ihren Kaffee ;
Musikalische Umrahmung, verschiedene Animationen (Saxophon, Kontrabass, Keyboard und Gesang).


Kindermenü

Coté Bac à Sable (Altersgrenze 10 Jahre)
- 1 Club-Sandwich mit Schinken, Butter und Emmentaler Käse, 1 Tüte Chips, 1 Dessert Magnum by B Version Eichhörnchen ** aus dem Haus Baillet in Ay-Champagne, 1 Caprisun, eine Überraschung.

**Magnum B Version Eichhörnchen - Schokoladenmousse, Haselnussmousse, Schokoladenbiskuit, Milchschokolade mit Mandeln.

en:
On Sunday June 25, the Château de Pierry once again opens the gates of its private garden to welcome you to its 2nd musical picnic.

A summer menu will be served, with a glass of Paul Gobillard champagne offered on arrival.
- A small salad of Champagne lentils with cherry tomatoes, marinated artichoke hearts, zucchini, red onions, arugula in pesto sauce, topped with mozzarella di bufala;
- A la plancha butcher's cut or poultry supreme or sea bass fillet, served with grilled potatoes and/or baby vegetables;
- Its aged Brie de Meaux ;
- His délice Magnum** by B by Maison Baillet in Ay- Champagne, a signature dessert approved and tasted by the jury of France's Best Bakery

* *Magnum - Yuzu temptation mousse, light raspberry cream, raspberries, pink Champagne cookie punched with Yuzu, chocolate

1/2 bottle of water ;
Coffee;
Musical ambience and entertainment (saxophone, double bass, keyboard and vocals).


Children's menu

Coté Bac à Sable (age limit 10 years)
- 1 club sandwich with ham and Emmental butter, 1 packet of chips, a Magnum by B Ecureuil ** dessert from Maison Baillet in Ay-Champagne, 1 Caprisun, a surprise.

**Magnum B version Ecureuil - Chocolate mousse, hazelnut mousse, chocolate cookie, milk chocolate with almonds.

it:
Domenica 25 giugno, lo Château de Pierry aprirà nuovamente i cancelli del suo giardino privato per accogliervi al 2° picnic musicale.

Verrà servito un menu estivo, con una coppa di champagne Paul Gobillard all'arrivo.
- Insalatina di lenticchie allo Champagne con pomodori ciliegini, cuori di carciofo marinati, zucchine, cipolle rosse, rucola con salsa al pesto e mozzarella di bufala;
- Tagliata di macelleria o suprema di pollame o filetto di branzino alla plancha, serviti con patate grigliate e/o verdure novelle;
- Il suo Brie de Meaux stagionato;
- Magnum** di B della Maison Baillet in Ay-Champagne, un dessert d'autore approvato e degustato dalla giuria della Migliore pasticceria di Francia

* *Magnum - Mousse di tentazione allo yuzu, crema leggera di lamponi, lamponi, biscotto rosa allo champagne punzonato con yuzu, cioccolato

1/2 bottiglia d'acqua;
Caffè;
Intrattenimento musicale (sassofono, contrabbasso, tastiera e voce).


Menu per bambini

Lato Sandbox (limite di età 10 anni)
- 1 club sandwich al prosciutto e burro di emmental, 1 pacchetto di patatine, un Magnum di B Ecureuil ** dessert della Maison Baillet di Ay-Champagne, 1 Caprisun, una sorpresa.

**Magnum B versione Ecureuil - Mousse al cioccolato, mousse alla nocciola, biscotto al cioccolato, cioccolato al latte con mandorle.

