- Sa pièce de boucher à la plancha ou son suprême de volaille ou son filet de bar, accompagnés de ses pommes de terre grenailles ou/et petits légumes ;
- Son Brie de Meaux affiné ;
- Son délice Magnum** by B par la Maison Baillet à Ay- Champagne, dessert signature approuvé et dégusté par le jury de la Meilleure Boulangerie de France 

* *Magnum - Mousse tentation Yuzu, crème légère framboise, framboises, biscuit rose champenois punché au Yuzu, chocolat

Sa 1/2 bouteille d'eau ;
Son café ;
Ambiance musicale, animations diverses (saxophone, contrebasse, clavier et chant).


Menu Enfant

Coté Bac à Sable (âge limite 10 ans)
- 1 club sandwich au jambon beurre emmental, 1 paquet de chips, un dessert Magnum by B version Ecureuil ** de la Maison Baillet à Ay-Champagne , 1 Caprisun, une surprise.

**Magnum B version Ecureuil - Mousse chocolat, Mousse à la noisette, biscuit chocolat, chocolat lait aux amandes.

