* *Magnum - Yuzu verleidingsmousse, lichte frambozencrème, frambozen, roze Champagnekoekje geponst met Yuzu, chocolade

1/2 fles water ;
Koffie;
Muzikale omlijsting (saxofoon, contrabas, keyboard en zang).


Kindermenu

Zandbakkant (leeftijdsgrens 10 jaar)
- 1 club sandwich met ham en emmentaler, 1 zakje chips, een Magnum van B Ecureuil ** dessert van Maison Baillet in Ay-Champagne, 1 Caprisun, een verrassing.

**Magnum B versie Ecureuil - Chocolademousse, hazelnootmousse, chocoladekoekje, melkchocolade met amandelen.

es:
