* *Magnum - Mousse de tentación de Yuzu, crema ligera de frambuesa, frambuesas, galleta rosa de Champagne troquelada con Yuzu, chocolate

1/2 botella de agua ;
Café;
Animación musical (saxofón, contrabajo, teclado y voz).


Menú infantil

Sandbox side (límite de edad 10 años)
- 1 sándwich club de jamón y mantequilla de emmental, 1 paquete de patatas fritas, un Magnum de B Ecureuil ** postre de la Maison Baillet de Ay-Champagne, 1 Caprisun, una sorpresa.

**Magnum B versión Ecureuil - Mousse de chocolate, mousse de avellanas, galleta de chocolate, chocolate con leche y almendras.

